<body>
    <div class="page">
        <div class="overview">
            <div class="headerTitle">
                <div class="role">Front-End Developer (Angular)</div>
                <div class="company">HorizonLex Solutions</div>
            </div>
            <div class="basicInfo">
                <span class="badge">Job Posting</span>
                <span>FE-ANG-2025</span>
                <span>Chicago, IL</span>
                <span>Full-time</span>
                <span>06/01/2024</span>
