        <div class="section">
            <div class="sectionTitle">Company & Culture</div>
            <div class="sectionBody culture">
                HorizonLex Solutions is a mid-size corporate technology firm specializing in workflow and analytics tools for enterprise B2B clients. Based in Chicago and operating within the software industry, the company emphasizes scalable and reliable products tailored for large organizations. Its culture is rooted in diversity, inclusion, and continuous improvement, offering a supportive and collaborative environment. Agile methodologies and cross-team mentorship are central, and employees are encouraged to grow into technical or leadership roles. The company values proactive learning, shared growth, and the drive to modernize while ensuring mission-critical reliability for clients.
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Benefits</div>
            <div class="sectionBody benefits">
                <ul class="benefitsList">
                    <li>Competitive base salary ($105,000  $130,000 USD, dependent on experience and location)</li>
                    <li>Annual performance bonus eligibility</li>
                    <li>Comprehensive medical, dental, and vision insurance plans</li>
                    <li>401(k) with company match</li>
                    <li>Generous paid time off (PTO), sick leave, and holidays</li>
                    <li>Professional development budget for courses, conferences, and certifications</li>
                    <li>Modern equipment and software options within guidelines</li>
                    <li>Hybrid work flexibility (23 days per week in office, remaining days remote)</li>
                    <li>Inclusive, growth-oriented, and collaborative work culture</li>
                    <li>Remote work flexibility</li>
                    <li>Wellness programs</li>
                    <li>Public transportation subsidy</li>
                    <li>Parental leave</li>
                    <li>Employee recognition programs</li>
                </ul>
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Role Overview</div>
            <div class="sectionBody jobInfo">
                <p>
                    As a Front-End Developer (Angular) at HorizonLex Solutions, you will be a core member of the Product Engineering team, reporting to the Front-End Engineering Manager. This mid-level, full-time role is based in Chicago with a flexible hybrid schedule (23 days per week on-site). You will collaborate closely with engineers, designers, and product managers to build and modernize user-facing features in the company''s Angular platform, serving enterprise B2B clients.
                </p>
                <p>
                    Primary responsibilities include enhancing, refactoring, and optimizing Angular applications, as well as developing new modules and features. You''ll translate design wireframes into modular Angular components and contribute to the company''s expanding design system and component library. The role requires a balance between maintaining robust legacy codebases and supporting new greenfield initiatives.
                </p>
                <p>
                    You''ll champion front-end best practices related to architecture, state management, modularization, testing, and performance optimization. Regular activities include writing testable TypeScript/HTML/CSS code to company standards, conducting code reviews, pair programming, and fostering team learning. Integration with RESTful APIs and troubleshooting cross-browser/device issues are also major aspects of the job.
                </p>
                <p>
                    The technical stack centers around Angular (v12+), TypeScript, RxJS, NgRx (or similar), HTML5, CSS/SCSS, and RESTful APIs, supported by tools like Jasmine, Karma, Jest, Git, and CI/CD pipelines (Azure DevOps, GitHub Actions). Familiarity with tools such as Webpack, ESLint, Prettier, and Storybook is advantageous. The role suits those with strong communication skills, a collaborative approach, and the drive to continuously improve both technology and processes. You will have opportunities for professional growth, including progression toward senior or technical leadership roles within a dynamic, inclusive company environment.
                </p>
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Required Skills & Proficiency</div>
