                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">CSS/SCSS</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-high">7</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">5</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        CSS and SCSS are critical for implementing responsive, consistent, and brand-aligned styling across complex Angular applications.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">RxJS</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-high">7</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">5</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Reactive programming with RxJS is a must-have for complex data flows and event handling in Angular projects.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">State management</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
