                    </div>
                    <span class="skillJustification">
                        Consuming and integrating with RESTful APIs is foundational for front-end/back-end collaboration in this role.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Front-end architecture</span>
                        <div class="skillLevels">
