                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Code review</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">4</span>
                        </div>
                    </div>
                    <span class="skillJustification">
