<body>
    <div class="page">
        <div class="overview">
            <div class="headerTitle">
                <div class="role">Junior C# Developer</div>
                <div class="company">Northbridge Software Group</div>
            </div>
            <div class="basicInfo">
                <span class="badge">Job Posting</span>
                
                <span>Chicago, IL (Hybrid: 2-3 days/week onsite)</span>
                <span>Full-time</span>
                <span>06/18/2024</span>
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Company & Culture</div>
            <div class="sectionBody culture">
                Northbridge Software Group is a mid-sized technology company headquartered in Chicago, Illinois, with over 150 employees serving clients in finance, logistics, and healthcare. The engineering team is committed to clean code, mentorship, and professional development within a collaborative and knowledge-sharing environment. The company balances a structured, mentorship-driven setting with the flexibility of a hybrid work model, supporting growth and career advancement from junior to mid-level roles. Team members are encouraged to learn, receive and act on feedback, and participate fully in Agile work processes. The culture values careful, high-quality work, open communication, and mutual support.
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Benefits</div>
            <div class="sectionBody benefits">
                <ul class="benefitsList">
                    <li>Competitive salary for junior-level software engineers</li>
                    <li>Hybrid work arrangement (2-3 days per week onsite in Chicago office)</li>
                    <li>Comprehensive health, dental, and vision insurance</li>
                    <li>401(k) plan with company matching</li>
                    <li>Generous paid time off and paid holidays</li>
                    <li>Structured onboarding with mentorship from senior developers</li>
                    <li>Training budget for courses, certifications, and conferences</li>
                    <li>Clear advancement path toward mid-level Software Engineer roles</li>
                </ul>
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Role Overview</div>
            <div class="sectionBody jobInfo">
                <p>
                    As a Junior C# Developer at Northbridge Software Group, you will join the Engineering team to contribute to the development of business and analytics software for clients in diverse industries. Reporting to the Application Development Team and working closely with senior developers, you will help implement features and resolve bugs primarily using C# and .NET 6+ (or .NET Core).
                </p>
                <p>
                    Core responsibilities include building RESTful APIs, data access layers, and background services; assisting with SQL Server database queries and schema changes; and collaborating in the design, implementation, and refactoring of software components. You will participate actively in code reviews, sprint planning, and daily stand-ups within an Agile environment, and write unit tests to ensure high code quality and coverage.
                </p>
                <p>
                    The role may also involve optional contribution to front-end development using JavaScript/TypeScript, HTML, CSS, and modern frameworks such as React or Angular. You will be expected to help diagnose and troubleshoot technical issues across development, test, and production environments, as well as document your work and share technical insights with the team.
                </p>
                <p>
                    The ideal candidate brings 1-2 years of professional experience in C# development, familiarity with .NET Core or ASP.NET (MVC/Web API), solid understanding of object-oriented programming, and practical SQL skills, especially with SQL Server. Strong problem-solving abilities, solid communication skills, and team orientation are essential. While the role encourages learning and growth, U.S. work authorization is required, as visa sponsorship is not available.
                </p>
                <p>
                    This opportunity provides structured mentorship, a collaborative culture, and a clear growth path for junior engineers to advance their skills and careers in a stable technology company.
                </p>
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Required Skills & Proficiency</div>
            <div class="sectionBody skillList">
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">c#</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">5</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        The core requirement is 1-2 years of professional experience with C#, including hands-on implementation of features, bug fixes, and collaboration with senior developers. This level matches the expectations for a junior developer with foundational and practical experience. The minimum is set to 5 due to the explicit 1+ years prerequisite, but intensive mentorship and onboarding could permit some newcomers.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">.NET Platform & APIs</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">5</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Proficiency with .NET Core, .NET 5+, or ASP.NET (MVC/Web API) is specifically required, as all major backend tasks depend on this stack. Junior level is expected, so solid practical experience but not senior mastery is needed. Minimum also set at 5 per junior expectations and chance for on-the-job learning.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">SQL</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">5</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Experience with SQL, specifically SQL Server, is a core part of the job, supported by responsibilities for queries and schema modifications. Required at a solid junior level; not expert-level but more than basic exposure. Minimum suggests practical basic proficiency.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Object-oriented programming</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">4</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        OOP principles and design patterns are explicitly mentioned as required knowledge. Junior roles require working understanding and the ability to collaborate on codebases designed with these principles. Minimum reflects foundational grasp and willingness to learn further.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Source control systems</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">5</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Version control with Git or similar is required for source code management, a routine expectation in collaborative teams. Desired and minimum levels both reflect routine daily usage typical of even early-career developers.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Team collaboration</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">4</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Close collaboration with senior developers and engagement in Agile rituals are central to both the culture and duties. Junior developers are expected to contribute and communicate regularly in group settings. Minimum reflects openness for some ramp-up for new grads.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Problem solving</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">4</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Strong problem-solving skills and attention to detail are listed as required. The junior role needs candidates to approach debugging and issue resolution proactively, though depth of experience with highly complex issues is not demanded.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Communication</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">6</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-medium">4</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Good verbal and written communication skills are explicitly required and are reinforced by a collaborative, feedback-rich environment. Junior level means solid contribution and willingness to ask and share.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">RESTful APIs</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">5</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-low">3</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        REST API development and understanding are part of the responsibilities. Required at a functional but not advanced level; junior candidates are expected to implement basic endpoints and understand typical REST use cases. Minimum set to practical entry.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Unit testing</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">5</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-low">3</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Writing unit tests, improving test coverage, and some exposure to xUnit/NUnit/MSTest are expected. Emphasis is on foundational understanding and ability to participate, not test automation ownership. Minimum can be lower as on-the-job support is likely.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Technical documentation</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">5</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-low">3</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Documenting development work and sharing knowledge is part of the role''s stated duties. Junior contributors must reliably record and communicate technical progress. Minimum level reflects basic documentation proficiency.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Agile</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-medium">5</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-low">3</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Participation in Agile processes such as sprint planning and stand-ups is expected. Experience is nice-to-have but not strictly required for juniors; both desired and minimum levels reflect foundational familiarity or readiness to adopt Agile routines.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Mentorship</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-low">4</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-low">3</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        While direct mentoring of others is not expected, receiving and engaging with mentorship is central to the onboarding and development structure. The skill pertains mainly to being open to guidance and applying feedback. Desired and minimum levels are modest for a junior role.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Frontend architecture</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-low">4</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-low">2</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Front-end experience (JavaScript/TypeScript, HTML, CSS, and frameworks like React or Angular) is described as optional and nice to have. The junior role may involve some contributions; this skill is secondary, so levels are low but included given preference indicated.
                    </span>
                </div>
                <div class="skillEntry">
                    <div class="skillHeaderRow">
                        <span class="skillName">Entity Framework Core</span>
                        <div class="skillLevels">
                            <span class="label">Desired:</span>
                            <span class="desiredSkillLevel level-low">4</span>
                            <span class="label">Minimum:</span>
                            <span class="minimumSkillLevel level-low">2</span>
                        </div>
                    </div>
                    <span class="skillJustification">
                        Knowledge of Entity Framework or other ORMs is listed as preferred. This is supplemental and not required for success in the core backend role; desired level is elementary to early working, and minimum is basic awareness.
                    </span>
                </div>
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">How to Apply / Contact</div>
            <div class="sectionBody contactInfo">
                <div class="contactInfoItem">
                    <span class="contactLabel">Contact Name:</span>
                    <span></span>
