                    <span>Submit your resume and a brief cover letter highlighting your C# experience and learning goals to the provided email address, using the subject line: "Junior C# Developer  [Your Name]". Links to your GitHub or relevant projects are encouraged.</span>
                </div>
            </div>
        </div>
    </div>
</body>
